import React from "react";
import styles from "../../UserProfile/UserProfile.module.scss";

const CreateTask = () => {
  return (
    <div className={styles.title_wrapper}>
      <h2 className={styles.title}>Plan </h2>
      <span>your day</span>
      {isCreateTask ? (
        <button
          className={styles.onTask}
          onClick={() => setIsCreateTask(false)}
        >
          create your task
        </button>
      ) : (
        <button className={styles.onTask} onClick={() => setIsCreateTask(true)}>
          create your task
        </button>
      )}
    </div>
  );
};

export default CreateTask;
